import "core-js/modules/es.array.push.js";
import axios from "axios";
export default {
  name: "prestataireSignupManege",
  data: () => {
    return {
      id_user: null,
      id: null,
      registered: null,
      emplacements: [],
      manege: {},
      map: null,
      selectedPath: null,
      selectedOption: 'unselect',
      selectedObjects: [],
      datedebut: null,
      datefin: null,
      inputDateDebut: null,
      inputDateFin: null
    };
  },
  methods: {
    goTo(path) {
      this.$router.replace(path);
    },
    getData() {
      this.id_user = this.$store.state.user.id;
      this.id = this.$route.params.id;
      axios({
        method: 'get',
        url: 'http://localhost:3000/prestataires/' + this.id_user + '/manege/' + this.id + '/signup'
      }).then(result => {
        this.registered = result.data.data.alreadyRegistered;
        this.emplacements = result.data.data.emplacements;
        this.manege = result.data.data.manege;
        this.map = document.querySelector('.mapSignupManege');
        let dateDebut = this.$store.state.manifestation.datedebut;
        this.inputDateDebut = dateDebut.split('/')[2] + '-' + dateDebut.split('/')[1] + '-' + dateDebut.split('/')[0];
        let dateFin = this.$store.state.manifestation.datefin;
        this.inputDateFin = dateFin.split('/')[2] + '-' + dateFin.split('/')[1] + '-' + dateFin.split('/')[0];
      }).catch(error => {
        console.log(error);
      });
    },
    getEmplacementsID() {
      let emplacements = [];
      this.emplacements.forEach(e => {
        if (!emplacements.includes(e.id_emplacement)) emplacements.push(e.id_emplacement);
      });
      return emplacements;
    },
    changeMap() {
      let select = this.map.querySelector('#selectMap');
      let opacity = 100;
      if (select.checked) opacity = 0;
      this.map.querySelector('#satelite').style.opacity = opacity;
    },
    changeSelectedPath(id) {
      this.selectedOption = id;
      this.selectedPath = id;
      this.activeArea();
    },
    activeArea() {
      this.selectedObjects = [];
      if (this.selectedOption) this.selectedPath = null;
      this.map.querySelectorAll('[name="map"]').forEach(p => {
        p.style.fill = 'grey';
      });
      let path = this.map.querySelector('#' + this.selectedPath);
      if (this.selectedOption) path = this.map.querySelector('#' + this.selectedOption);
      path.style.fill = 'blue';
      this.emplacements.forEach(e => {
        let id = parseInt(path.id.split('manege')[1]);
        if (e.id_emplacement === id) this.selectedObjects.push(e);
      });
      this.map.querySelector('.mapSignupManege__display').style.display = 'block';
    },
    cancel() {
      if (confirm(this.$t('confirm.cancel'))) {
        axios({
          method: 'post',
          url: 'http://localhost:3000/prestataires/' + this.id_user + '/manege/' + this.id + '/cancelSignup',
          data: {
            id_manifestation: this.$store.state.manifestation.id
          }
        }).then(result => {
          this.$store.commit('setMessage', result.data);
          this.getData();
        }).catch(error => {
          console.log(error);
        });
      }
    },
    signup() {
      let dateDebutManifestation = this.$store.state.manifestation.datedebut;
      let dateFinManifestation = this.$store.state.manifestation.datefin;
      let debut = new Date(dateDebutManifestation.split('/')[2] + '-' + dateDebutManifestation.split('/')[1] + '-' + dateDebutManifestation.split('/')[0]).getTime();
      let fin = new Date(dateFinManifestation.split('/')[2] + '-' + dateFinManifestation.split('/')[1] + '-' + dateFinManifestation.split('/')[0]).getTime();
      let dateDebut = new Date(this.datedebut).getTime();
      let dateFin = new Date(this.datefin).getTime();
      let error = false;
      if (!dateDebut || dateDebut < debut || dateDebut > fin) {
        this.map.querySelector('#datedebut').style.borderColor = 'red';
        this.$store.commit('setMessage', {
          success: 0,
          data: `La date de début ne correspond pas aux dates de l'évènement (du ${this.inputDateDebut} au ${this.inputDateFin})`
        });
        error = true;
      } else this.map.querySelector('#datedebut').style.borderColor = 'green';
      if (!dateFin || dateFin > fin || dateFin <= dateDebut) {
        this.map.querySelector('#datefin').style.borderColor = 'red';
        this.$store.commit('setMessage', {
          success: 0,
          data: `La date de fin ne correspond pas aux dates de l'évènement (du ${this.inputDateDebut} au ${this.inputDateFin})`
        });
        error = true;
      } else this.map.querySelector('#datefin').style.borderColor = 'green';
      let dateDebutO, dateFinO;
      this.selectedObjects.forEach(o => {
        if (o.datedebut) {
          dateDebutO = new Date(o.datedebut.split('/')[2] + '-' + o.datedebut.split('/')[1] + '-' + o.datedebut.split('/')[0]);
          dateFinO = new Date(o.datefin.split('/')[2] + '-' + o.datefin.split('/')[1] + '-' + o.datefin.split('/')[0]);
          if (dateDebut >= dateDebutO && dateDebut <= dateFinO) {
            this.map.querySelector('#datedebut').style.borderColor = 'red';
            this.$store.commit('setMessage', {
              success: 0,
              data: 'La date de début est incompatible avec les créneaux déjà réservés'
            });
            error = true;
          }
          if (dateFin >= dateDebutO && dateFin <= dateFinO) {
            this.map.querySelector('#datefin').style.borderColor = 'red';
            this.$store.commit('setMessage', {
              success: 0,
              data: 'La date de fin est incompatible avec les créneaux déjà réservés'
            });
            error = true;
          }
          if (dateDebutO > dateDebut && dateFinO < dateFin) {
            this.map.querySelector('#datefin').style.borderColor = 'red';
            this.$store.commit('setMessage', {
              success: 0,
              data: 'La date de fin est incompatible avec les créneaux déjà réservés'
            });
            error = true;
          }
        }
      });
      if (!error) {
        axios({
          method: 'post',
          url: 'http://localhost:3000/prestataires/' + this.id_user + '/manege/' + this.id + '/signupPost',
          data: {
            id_emplacement: this.selectedOption.split('manege')[1],
            id_manifestation: this.$store.state.manifestation.id,
            datedebut: this.datedebut,
            datefin: this.datefin
          }
        }).then(result => {
          this.$store.commit('setMessage', result.data);
          this.getData();
        }).catch(error => {
          console.log(error);
        });
      }
    }
  },
  mounted() {
    this.getData();
  }
};
